import React,{Component} from 'react'
import Item from '../item'
import './index.css'
export default class List extends Component{
    render(){
        return(
           <ul>
              {
                  this.props.todos.map((n)=>{
                      console.log(n.id);
                     return <Item key={n.id} {...n}/>
                  })
              }
           </ul>
        )
    }
}
